(2110, 951, 0, 1, '彗星', '', '0000-00-00 00:00:00', 0000, 15, 1, 4, '學習如何激發出更耀眼的光芒 走路轉身倒退走也許顏色不一樣\r\n因為我想到更遠的地方 學會發亮能不能像你一樣\r\n請聽到我的請求告訴我飛翔的方法 就算辛苦摸索不懂也不會沮喪\r\n因為我想跟在你的身旁 那裡會有最美麗的夕陽\r\n\r\n我是想衝破天空飛翔的流星 跟隨你白色腳印\r\n往那宇宙裡旅行\r\n\r\n我要追逐你絢爛的身影 不論將往哪裡去\r\n就算會失去我自己\r\n\r\n就在我衝刺的時候收到一個願望 希望有天我能成為偉大音樂家\r\n祝福你能繼續你的夢想 就算失敗也能笑著倒下\r\n\r\n我是想衝破天空飛翔的流星 跟隨你白色腳印\r\n往那宇宙裡旅行\r\n\r\n我要追逐你絢爛的身影 不論將往哪裡去\r\n就算會失去我自己\r\n\r\n衝破天空飛翔的流星 跟隨你白色腳印\r\n往那宇宙裡旅行\r\n\r\n我要追逐你絢爛的身影 不論將往哪裡去\r\n就算會失去我自己', '', 0, '', '陳修澤', '陳修澤', '王騰逸', '', '', 0, 0, 1, '2008-04-22 18:22:40', '2013-10-07 17:11:49', '0000-00-00 00:00:00'),
