(2314, 33, 361, 1, '空中飛人', '', '2008-04-24 00:00:00', 0000, 10, 0, 7, '漫遊狂風呼嘯 在高空不會跌下\r\n踩著晃蕩繩索 藍天就是我的家\r\n\r\n因為我是 空中飛人\r\n\r\n萊特兄弟的發明實現了人類的夢想\r\n觸碰它的鼻子 旋轉就能夠翱翔\r\n\r\n全世界渴望 直上雲霄\r\n可是我沒有翅膀 就能飛翔\r\n\r\n用我雙腳 踏在雲彩上\r\n他們見到 就欣喜若狂\r\n可我試著 想要向下爬\r\n否則世界都要變成灰呀啊\r\n\r\n這是我令人羨慕的詛咒\r\n永遠地向上爬升卻不回頭\r\n\r\n變得無二獨一 行走在蒼穹天際\r\n曾經也想卓越 這一切令人著迷\r\n\r\n在迷濛的夜 於是察覺\r\n你習慣的笑顏 消失不見\r\n\r\n用我雙腳 踏在雲彩上\r\n他們見到 就欣喜若狂\r\n可我試著 想要像下爬\r\n否則世界都要變成灰呀啊\r\n\r\n這是我令人羨慕的詛咒\r\n永遠地向上爬升卻不回頭\r\n看著那熟悉面容卻逐漸剝落\r\n別讓我墜落在宇宙\r\n\r\n空中飛人 我閉上雙眼 脫掉我的雙腿 就能墜毀\r\n空中飛人 要回到地面 握著你的手掌 想要迫降\r\n空中飛人 要變得平凡 去享受你的愛 我好期待', '', 0, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 0, 0, 1, '2008-04-24 10:44:52', '2013-10-07 17:11:52', '0000-00-00 00:00:00');
